import React from 'react';
import Plot from 'react-plotly.js';


function BachelorsData() {
  return (
    <Plot
      data={[
        {
          x: [1, 2, 3],
          y: [2, 6, 3],
          type: 'scatter',
          mode: 'lines+markers',
          marker: {color: 'red'},
        },
        {type: 'bar', x: [1, 2, 3], y: [2, 5, 3]},
      ]}
      layout={{width: 100, height: "auto", title: 'Bachelor Degrees in Computer Science Conferred by Post-Secondary Institutions (1970-2003)'}}
    />
  );
}

export default BachelorsData;
